import { StyleSheet, Text, TouchableOpacity, View } from 'react-native';


function ButtonClick({title, background,onPress,disable}){
  return (
    <TouchableOpacity onPress={()=> !disable && onPress() } style={[styles.button,{backgroundColor: background}]} activeOpacity={ disable ? 1.0: 0.5}>
      <View style={styles.buttonBorder}>
        <Text style={styles.buttonTitle}>{title}</Text>
      </View>
    </TouchableOpacity>
  )
}

const styles = StyleSheet.create({
  button:{
    width: 80,
    height: 80,
    borderRadius:40,
    justifyContent:'center',
    alignContent:'center'
  },
  buttonTitle:{
    fontSize:18,
    color: 'white'
  },
  buttonBorder:{
    width: 76,
    height: 76,
    borderRadius:38,
    borderWidth:1,
    justifyContent:'center',
    alignContent:'center'
  },

});

export default Button;
